import React from 'react'

class Login extends React.Component{
    constructor(){
        super();
        this.state = {
            loginForm: false,
        }
    }

    render(){
        return(
            <div className="LoginForm">
            <div className="loginButton">
                login
            </div>
            </div>
        );
    }
}

export default Login;
